declare  @tempDataImport as [TYPE_ROLEMEASURE_IMPORT]



update @tempDataImport set Country = LTRIM(RTRIM(Country))
update @tempDataImport set BusinessUnit = LTRIM(RTRIM(BusinessUnit))
update @tempDataImport set [Role] = LTRIM(RTRIM([Role]))
update @tempDataImport set Measure = LTRIM(RTRIM(Measure))
update @tempDataImport set Frequency = LTRIM(RTRIM(Frequency))
update @tempDataImport set PayoutCurve = LTRIM(RTRIM(PayoutCurve))
update @tempDataImport set PayoutType = LTRIM(RTRIM(PayoutType))
update @tempDataImport set IncentivePayout = LTRIM(RTRIM(IncentivePayout))
exec Proc_ImportRoleMeasure @tempDataImport
update PlanModifier set DataType='Inventory level 2018 vs 2017'  where DataType='Inventory level 2017 vs 2016'

